const CACHE_NAME="contact-card-v1",urlsToCache=["/memo/","/memo/index.html","/memo/bundle.js","/memo/354.bundle.js"];self.addEventListener("install",e=>{e.waitUntil(caches.open(CACHE_NAME).then(e=>e.addAll(urlsToCache)).then(()=>self.skipWaiting()))}),self.addEventListener("activate",e=>{e.waitUntil(caches.keys().then(e=>Promise.all(e.map(e=>{if(e!==CACHE_NAME)return caches.delete(e)}))).then(()=>self.clients.claim()))}),self.addEventListener("fetch",e=>{e.respondWith(fetch(e.request).then(t=>{if(t&&200===t.status){const s=t.clone();caches.open(CACHE_NAME).then(t=>t.put(e.request,s))}return t}).catch(()=>caches.match(e.request)))});